import './App.css';
import React, {useEffect, useState} from 'react';
import axios from 'axios';
import styled from "styled-components";
import * as ReactBootStrap from 'react-bootstrap';

axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';

const App = () => {
  const [apiResponse, setApiResponse] = useState({
    match_table : '',
    f1_score : 0
  })

  const [test, setTest] = useState({
    match_table : '',
    f1_score : 0,
    loaded: false,
    code : 0,
    notavail: false
  })

  const [today, setToday] = useState({
    match_table : '',
    f1_score : 0,
    loaded: false,
    code : 0,
    notavail: false
  })

  const [tomorrow, setTomorrow] = useState({
    match_table : '',
    f1_score : 0,
    loaded: false,
    code : 0,
    notavail: false
  })

  const [yesterday, setYesterday] = useState({
    match_table : '',
    f1_score : 0,
    loaded: false,
    code : 0,
    notavail: false
  })

  const apiCallTest = async () => {
    try {
      axios.get('http://localhost:5000/predict/test').then(response => {
      setTest({
        match_table : response.data.message,
        f1_score : response.data.F1_Score,
        loaded: true,
        code : response.status
      })
      if(response.data.message === 'NA'){
        setTest({
          notavail: true
        })
      }
    });
    } catch (e) {
      console.log(e);
    }
  };

  const apiCallToday = async () => {
    try {
      axios.get('http://localhost:5000/predict/today').then(response => {
      setToday({
        match_table : response.data.message,
        f1_score : response.data.F1_Score,
        loaded: true,
        code : response.status
      })
      if(response.data.message === 'NA'){
        setToday({
          notavail: true
        })
      }
    });
    } catch (e) {
      console.log(e);
    }
  };

  const apiCallYesterday = async () => {
    try {
      axios.get('http://localhost:5000/predict/yesterday').then(response => {
      setYesterday({
        match_table : response.data.message,
        f1_score : response.data.F1_Score,
        loaded: true,
        code : response.status
      })
      if(response.data.message === 'NA'){
        setYesterday({
          notavail: true
        })
      }
    });
    } catch (e) {
      console.log(e);
    }
  };

  const apiCallTomorrow = async () => {
    try {
      axios.get('http://localhost:5000/predict/tomorrow').then(response => {
      setTomorrow({
        match_table : response.data.message,
        f1_score : response.data.F1_Score,
        loaded: true,
        code : response.status
      })
      if(response.data.message === 'NA'){
        setTomorrow({
          notavail: true
        })
      }
    });
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    apiCallTest();
    apiCallYesterday();
    apiCallToday();
    apiCallTomorrow();
  }, []);

  // useEffect(() => {
  //   apiCallToday();
  // }, []);

  // useEffect(() => {
  //   apiCallTomorrow();
  // }, []);

  // useEffect(() => {
  //   apiCallYesterday();
  // }, []);



  const Tab = styled.button`
    padding: 10px 40px;
    cursor: pointer;
    opacity: 0.6;
    background: white;
    border: 0;
    outline: 0;
    border-bottom: 2px solid transparent;
    transition: ease border-bottom 250ms;
    ${({ active }) =>
      active &&
      `
      border-bottom: 2px solid black;
      opacity: 1;
    `}
  `;

  function Table(props) {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Player 1</th>
              <th>Player 2</th>
              <th>Match Result</th>
              <th>Predicted Result</th>
            </tr>
          </thead>
          <tbody>
            {props.notavail ?  <p>dsafasfd</p>:
            (props && props.match_table && props.match_table.slice(1, props.match_table.length).map((item, index) => {
              return (
                <tr>
                  <td>{item[0]}</td>
                  <td>{item[1]}</td>
                  <td>{item[2]}</td>
                  <td>{item[3]}</td>
                </tr>
              );
            })) 
          }
          </tbody>
        </table>
      </div>
    );
  }

  function TabGroup() {
    const [active, setActive] = useState(types[0]);
    return (
      <>
        <div>
          {types.map((type) => (
            <Tab
              key={type}
              active={active === type}
              onClick={() => {
                setActive(type)
              }}
            >
              {type}
            </Tab>
          ))}
        </div>
        <div>
          {(() => {
          switch (active) {
            case "fsddf": return today.notavail == true ? <p>adsfafs</p> : <ReactBootStrap.Spinner animation="border" />;
            case "fsdsdf": return test.notavail == true ? <p>adsfafs</p> : <ReactBootStrap.Spinner animation="border" />;
            case "fssddf": return tomorrow.message == 'NA' ? <p>adsfafs</p> : <ReactBootStrap.Spinner animation="border" />;
            case "fsdsdf": return yesterday.notavail == true ? <p>adsfafs</p> : <ReactBootStrap.Spinner animation="border" />;
            case "Test":   return test.loaded == true ? Table(test): <ReactBootStrap.Spinner animation="border" />;
            case "Yesterday": return yesterday.loaded == true ? Table(yesterday): <ReactBootStrap.Spinner animation="border" />;
            case "Today":  return today.loaded == true ? Table(today): <ReactBootStrap.Spinner animation="border" />;
            case "Tomorrow": return tomorrow.loaded == true ? Table(tomorrow): <ReactBootStrap.Spinner animation="border" />;
            default: return <p>no matches Avaliable</p>
          }
          })()}
        </div>

      </>
    );
  }

  const types = ["Test", "Yesterday", "Today", "Tomorrow"];

  return (
    <div>
      <TabGroup />  
    </div>
  );
}

export default App;
